import { store } from './App.tsx';

const Introduction = () => {
  store.dispatch({ type: { loc: 'introduction' } });

  return (
    <div className="main-introduction-wrapper">
      <div className="main-introduction-content">
        <div className="main-introduction-content-professor"></div>
        <div className="main-introduction-content-dept_software"></div>
      </div>
    </div>
  );
};

export default Introduction;
